import collections

class Solution:
    def findAnagrams(self, s, p):
        """
        :type s: str
        :type p: str
        :rtype: List[int]
        """

        count = collections.Counter(p)
        returnArray = []
        lens = len(s)
        lenp = len(p)

        for i in range(lens-lenp+1):
            temp = s[i:i+lenp]
            temp_count = collections.Counter(temp)
            if temp_count == count:
                returnArray.append(i)

        return returnArray

s = Solution()
print(s.findAnagrams("cbaebabacd","abc"))
print(s.findAnagrams("",""))
